.aione-range-slider-value{

    position: absolute;
    top: -18px;
    right: 0;
    color: #FFFFFF;
    background: #E57373;
    padding: 0;
    display: inline-block;
    border-radius: 50%;
    width: 30px;
    height: 30px;
    text-align: center;
    font-size: 18px;
    line-height: 30px;
}


/* The slider itself */
.aione-range-slider {
    -webkit-appearance: none;  /* Override default CSS styles */
    appearance: none;
    margin-top:30px;
    margin-bottom:20px;
    width: 100%; /* Full-width */
    height: 8px; /* Specified height */
    padding:0;
    cursor: pointer;
    border-radius:4px;
    background: #666666; /* Grey background */
    outline: none; /* Remove outline */
    opacity: 0.8; /* Set transparency (for mouse-over effects on hover) */
    -webkit-transition: .2s; /* 0.2 seconds transition on hover */
    transition: opacity .2s;
}

/* Mouse-over effects */
.aione-range-slider:hover {
    opacity: 1; /* Fully shown on mouse-over */
}


/* The slider handle (use -webkit- (Chrome, Opera, Safari, Edge) and -moz- (Firefox) to override default look) */ 
.aione-range-slider::-webkit-slider-thumb {
    -webkit-appearance: none; /* Override default look */
    appearance: none;
    width: 30px; /* Set a specific slider handle width */
    height: 30px; /* Slider handle height */
    background: #4CAF50; /* Green background */
    cursor: pointer; /* Cursor on hover */
    -webkit-border-radius:15px;
    border-radius:15px;
}


.aione-range-slider::-moz-range-thumb {
    width: 30px; /* Set a specific slider handle width */
    height: 30px; /* Slider handle height */
    background: #4CAF50; /* Green background */
    cursor: pointer; /* Cursor on hover */
    -moz-border-radius:15px;
    border-radius:15px;
}

.aione-range-slider::-ms-fill-lower {
    background: #666666;
}
.aione-range-slider::-ms-fill-upper {
    background: #666666;
}
.aione-range-slider::-ms-thumb {
    background: #4CAF50;
    width:30px;
}
.aione-range-slider::-ms-track {
    color: #333333;
}

