$(document).ready(function() {
    
    $('.field-wrapper-type-number.range').each(function(){
        if($(this).hasClass("scale-1-10-1")){
         var html = '<input type="range" min="1" max="10" step="1" value="1" class="aione-range-slider">';
         console.log("range-10");
        } else {
            var html = '<input type="range" min="1" max="5" step="1" value="1" class="aione-range-slider">';
        
        }
        html += '<span class="aione-range-slider-value">1</span>';
        $(this).find('.field').append(html);
    });
    $('.field .aione-range-slider').change(function(){
        var value = $(this).val();
        $(this).attr('id','value'+value);
        $(this).parent().find('.aione-range-slider-value').html(value);
        $(this).parent().find('input[type=number]').val(value);
        console.log($(this).parent().find('input[type=number]').attr('id')+' = '+$(this).parent().find('input[type=number]').val())
        if(value <= 2){$(this).parent().find('.aione-range-slider-value').css('background-color','#E57373');}
        if(value > 2){$(this).parent().find('.aione-range-slider-value').css('background-color','#f9a825');}
        if(value > 3){$(this).parent().find('.aione-range-slider-value').css('background-color','#71ba78');}

    });
    
    
});
